import React from "react";
import { FaSearch } from "react-icons/fa";

function AssetSearchBar() {
  return (
    <div style={{ 
      width: "335px",
      height: "44px",
      borderRadius: "6px 0px 0px 0px",
      border: "1px solid transparent",
      borderTopColor: "#007BFF", // Adjust border color if needed
      opacity: 1, // Set to 1 for visibility
      display: "flex",
      alignItems: "center",
      padding: "8px",
    }}>
      <FaSearch style={{ marginRight: "8px", color: "#ccc" }} />
      <input
        type="text"
        placeholder="Search for Assets"
        style={{ 
          border: "none", 
          outline: "none", 
          width: "100%", 
          height: "100%",
          opacity: 1, // Ensure input is visible
        }}
      />
    </div>
  );
}

export default AssetSearchBar;
